import React, {Component} from 'react';
  
class ToDo extends Component {
    
    state={ };

    render() {
        return (
            <div>
            <div className="card" style={{margin:100}}>
            <div className="card-body">
                <div className="row">
                    <div className="col-6">
                       <form>
                          <input type="text" className="form-control" placeholder="Search"/>
                       </form>
                    </div>
               </div>
           </div>
        </div>
            </div>
      
        );
    }
}

export default ToDo;
